import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const SymptomView = (props) => {
    const [symptom, setSymptom] = useState({})
    const [searchSymptom] = useParams()

    useEffect(() => {
        axios.post('https://symptom-checker4.p.rapidapi.com/analyze', {
            symptoms: searchSymptom
        }, {
            headers: {
                'content-type': 'application/json',
                'X-RapidAPI-Key': '8d95881717mshb150bac71409acbp1dbee3jsn2097310c3b61',
                'X-RapidAPI-Host': 'symptom-checker4.p.rapidapi.com'
            }
        })
            .then(res => {
                setSymptom(res.data);
                console.log(res.data);
            })
            .catch(err => {
                console.log(err);
            });
    }, [searchSymptom]);


    return (
        <div>
            <div>
                <h1>Symptom Details</h1>
                <p>{symptom.symptoms}</p>

                <h2>Potential Causes:</h2>
                <ul>
                    {symptom.potentialCauses.map((cause, index) => (
                        <li key={index}>{cause}</li>
                    ))}
                </ul>

                <h2>Follow-up Questions:</h2>
                <ul>
                    {symptom.followupQuestions.map((question, index) => (
                        <li key={index}>{question}</li>
                    ))}
                </ul>
            </div>
        </div>
    )
}

export default SymptomView
